normandpllc-animations.css.rules:
/* Disable complex animations on mobile */
  [data-scroll] {
    opacity: 1 !important;
    transform: none !important;
  }

  .parallax-img {
    transform: none !important;
  }

  /* Simplify hover effects */
  .card:hover {
    transform: none;
  }

  /* Reduce animation complexity */
  .fade-in,
  .fade-in-left,
  .fade-in-right,
  .scale-in {
    opacity: 1;
    transform: none;
    transition: opacity 0.3s;
  }

*,
  *::before,
  *::after {
    animation-duration: 0.01ms !important;
    animation-iteration-count: 1 !important;
    transition-duration: 0.01ms !important;
    scroll-behavior: auto !important;
  }

  .preloader {
    display: none;
  }

  .fade-in,
  .fade-in-left,
  .fade-in-right,
  .scale-in,
  .hero-tagline,
  .hero-subtitle,
  .hero-title,
  .hero-secondary {
    opacity: 1;
    transform: none;
  }

normandpllc-menu.css.rules:
.menu-toggle {
    background: var(--color-theme-black);
    position: fixed;
    top: 0;
    left: 0;
    right: 0;
    height: 45px;
    z-index: var(--z-menu-toggle);
  }

.menu-toggle,
  .menu-toggle-close {
    width: 130px;
    padding: 1em 0;
    position: fixed;
    top: 50%;
    left: 0;
    transform: translateY(-50%) rotate(-90deg);
    transform-origin: center;
    writing-mode: vertical-rl;
    text-orientation: mixed;
  }

  .menu-toggle span,
  .menu-toggle-close span {
    display: inline-block;
    transform: rotate(180deg);
  }

.menu-quick-contact-link {
    display: block;
    position: fixed;
    bottom: 2em;
    left: 0;
    width: 130px;
    text-align: center;
    transform: rotate(-90deg);
    transform-origin: center;
  }

.primary-menu-container {
    padding-top: 60px;
  }

  .menu-toggle-close {
    top: 0;
    left: 0;
    right: 0;
    height: 45px;
    transform: none;
    writing-mode: initial;
  }

normandpllc-styles.css.rules:
.nav-menu {
    position: fixed;
    top: 0;
    right: 0;
    width: 100%;
    height: 100vh;
    background: var(--primary-black);
    transform: translateX(100%);
    transition: transform var(--transition-smooth);
    overflow-y: auto;
    z-index: 1000;
  }

  .nav-menu.open {
    transform: translateX(0);
  }

  .nav-menu .nav-link {
    color: var(--primary-white);
    font-size: 32px;
    padding: 20px 40px;
    border-bottom: 1px solid rgba(255, 255, 255, 0.1);
  }

  .nav-menu .nav-link:hover {
    background: rgba(255, 107, 53, 0.1);
  }

*,
  *::before,
  *::after {
    animation-duration: 0.01ms !important;
    animation-iteration-count: 1 !important;
    transition-duration: 0.01ms !important;
  }

  .custom-cursor {
    display: none;
  }

  * {
    cursor: auto !important;
  }

